import React from 'react';
import './Home.css';  // Ensure you have this CSS file in your project

export default function Home() {
  return (
    <div className="home-container">
      <div className="text-section">
        {/* Updated h1 element with Tailwind CSS classes */}
        <h1 className="text-xl text-green-400 font-medium">Welcome to Our Website</h1>
        <p>This is the home page. We hope you find what you're looking for!</p>
      </div>
      <div className="image-section">
        {/* Ensure the correct path to your image file */}
        <img src="/assets/home/homeimage.png" alt="homeimage" />
      </div>
    </div>
  );
}
